import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { RouterModule } from '@angular/router';
import { MatIconModule } from '@angular/material/icon';

import { FooterComponent } from './footer/footer.component';
import { HeaderComponent } from './header/header.component';
import { BannerComponent } from './banner/banner.component';
import { ContenuAccueilComponent } from './contenu-accueil/contenu-accueil.component';
import { AccueilComponent } from './accueil/accueil.component';

@NgModule({
  declarations: [
    FooterComponent,
    HeaderComponent,
    BannerComponent,
    ContenuAccueilComponent,
    AccueilComponent,
  ],
  imports: [
    CommonModule,
    RouterModule,     // nécessaire pour [routerLink]
    MatIconModule     // nécessaire pour <mat-icon>
  ],
  exports: [
    FooterComponent,
    HeaderComponent,
    BannerComponent,
    ContenuAccueilComponent,
    AccueilComponent,
    RouterModule       // à exporter si utilisé ailleurs
  ]
})
export class UtilisateurModule { }
